import React, { useEffect, useState } from 'react'

const Button = (props) =>{
    const [click, setClick] = useState(1);
    console.log(click);
    useEffect(() => {
        document.title = `хуй ${click} см`
    })
    return (
        <button onClick={() => setClick(click + 1)} >{props.text}{click}</button>
    )
}

export default Button
